import { useEffect } from 'react';
import Home from './pages/Home';

const App = () => {
  useEffect(() => {
    document.querySelector('html').setAttribute('data-theme', 'light');
  }, []);

  return (
    <div data-theme='light'>
      <Home />
    </div>
  );
};

export default App;
